import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    astronaut: {
        justifyContent: 'center',
        alignItems: 'center',
        position: 'relative',
        top: 35,
        maxHeight: 630,
        maxWidth: 630,
    },
}));

export default useStyles;
